import React, { useState } from 'react';

const SurveillanceForm = () => {
  const [formData, setFormData] = useState({
    patientName: '',
    patientID: '',
    age: '',
    gender: '',
    dateOfAdmission: '',
    dateOfProcedure: '',
    admittingDepartment: '',
    departmentPrimarySurgeon: '',
    procedureName: '',
    diagnosis: '',
    procedureDoneBy: '',
    operationTheatre: '',
    outpatientProcedure: false,
    scenarioProcedure: 'Elective',
    woundClass: 'Clean',
    papGiven: false,
    durationPAP: '',
    ssiEventOccurred: false,
    dateOfEvent: ''
  });

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Submit the form data to the backend or handle form data submission here
    console.log(formData);
  };

  return (
    <div>
      <h2>Surgical Site Infection Surveillance Form</h2>
      <form onSubmit={handleSubmit}>
        <label>Patient Name:</label>
        <input 
          type="text" 
          name="patientName" 
          value={formData.patientName} 
          onChange={handleChange} 
        /><br/>

        <label>Patient ID:</label>
        <input 
          type="text" 
          name="patientID" 
          value={formData.patientID} 
          onChange={handleChange} 
        /><br/>

        <label>Age:</label>
        <input 
          type="number" 
          name="age" 
          value={formData.age} 
          onChange={handleChange} 
        /><br/>

        <label>Gender:</label>
        <select 
          name="gender" 
          value={formData.gender} 
          onChange={handleChange}>
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
          <option value="Other">Other</option>
        </select><br/>

        <label>Date of Admission:</label>
        <input 
          type="date" 
          name="dateOfAdmission" 
          value={formData.dateOfAdmission} 
          onChange={handleChange} 
        /><br/>

        <label>Date of Operative Procedure:</label>
        <input 
          type="date" 
          name="dateOfProcedure" 
          value={formData.dateOfProcedure} 
          onChange={handleChange} 
        /><br/>

        <label>Admitting Department:</label>
        <input 
          type="text" 
          name="admittingDepartment" 
          value={formData.admittingDepartment} 
          onChange={handleChange} 
        /><br/>

        <label>Department (Primary Surgeon):</label>
        <input 
          type="text" 
          name="departmentPrimarySurgeon" 
          value={formData.departmentPrimarySurgeon} 
          onChange={handleChange} 
        /><br/>

        <label>Name of Procedure:</label>
        <input 
          type="text" 
          name="procedureName" 
          value={formData.procedureName} 
          onChange={handleChange} 
        /><br/>

        <label>Diagnosis:</label>
        <input 
          type="text" 
          name="diagnosis" 
          value={formData.diagnosis} 
          onChange={handleChange} 
        /><br/>

        <label>Procedure done by (Primary Surgeon):</label>
        <input 
          type="text" 
          name="procedureDoneBy" 
          value={formData.procedureDoneBy} 
          onChange={handleChange} 
        /><br/>

        <label>Operation Theatre where Procedure done:</label>
        <input 
          type="text" 
          name="operationTheatre" 
          value={formData.operationTheatre} 
          onChange={handleChange} 
        /><br/>

        <label>Outpatient Procedure:</label>
        <input 
          type="checkbox" 
          name="outpatientProcedure" 
          checked={formData.outpatientProcedure} 
          onChange={handleChange} 
        /><br/>

        <label>Scenario of Procedure:</label>
        <select 
          name="scenarioProcedure" 
          value={formData.scenarioProcedure} 
          onChange={handleChange}>
          <option value="Elective">Elective</option>
          <option value="Emergency">Emergency</option>
        </select><br/>

        <label>Wound Class:</label>
        <select 
          name="woundClass" 
          value={formData.woundClass} 
          onChange={handleChange}>
          <option value="Clean">Clean</option>
          <option value="Clean Contaminated">Clean Contaminated</option>
          <option value="Contaminated">Contaminated</option>
          <option value="Dirty/Infected">Dirty/Infected</option>
        </select><br/>

        <label>Pre/Peri-operative Antibiotic Prophylaxis (PAP) given:</label>
        <input 
          type="checkbox" 
          name="papGiven" 
          checked={formData.papGiven} 
          onChange={handleChange} 
        /><br/>

        <label>Duration of PAP:</label>
        <input 
          type="text" 
          name="durationPAP" 
          value={formData.durationPAP} 
          onChange={handleChange} 
        /><br/>

        <label>SSI Event Occurred:</label>
        <input 
          type="checkbox" 
          name="ssiEventOccurred" 
          checked={formData.ssiEventOccurred} 
          onChange={handleChange} 
        /><br/>

        {formData.ssiEventOccurred && (
          <>
            <label>Date of Event:</label>
            <input 
              type="date" 
              name="dateOfEvent" 
              value={formData.dateOfEvent} 
              onChange={handleChange} 
            /><br/>
          </>
        )}

        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default SurveillanceForm;
